import React, { Component } from 'react';
import Layout from './../layouts/MainLayout';
import $ from 'jquery';
import SubNavBar from './../layouts/SubNavbar';
import {Url,ImageUrl} from './../constant/main'

class Index extends Component {

  constructor() {
    super();
    this.state = {
      orders:[]
    }

  }

  componentDidMount= ()=> {

    this.setState({
        orders:this.props.orders
    })
  }

  
render(){

    const sidenavconst = {topic : 'Categeries',topiclink:'All Categeriess',sidenavlink:[], visible:false };
  return(
<Layout>
<SubNavBar sidenavconst={sidenavconst}/> 
<br/>              

<table class="table table-striped container">
  <thead>
    <tr>
      <th scope="col">#</th>
      <th scope="col">First</th>
      <th scope="col">Last</th>
      <th scope="col">Handle</th>
    </tr>
  </thead>
  <tbody>

{this.state.orders.map((x,i)=>
    <tr key={i}>
    <th> <img width="50px" src={ImageUrl+x.item.images[0]} /></th>
    <td> 
        <div> <p>{x.item.itemname} </p>
            <p>{x.item.subcategery} </p>
        </div> 
    </td>
    <td>{x.item.itemPrice}</td>
    <td>chanaka sanjeewA</td>
    </tr>
    )}

  </tbody>
</table>
</Layout>
  )
}
 
}


  Index.getInitialProps = async function(context) {
    const { id } = context.query;

    const res = await fetch(`${Url}orderbyshopid/5e8889a438747936580d85c8`);
    var  orders = await res.json();
    var error = false;
 //   if(res.status!=200){
        error = true ;
  // }

    return {orders:orders,error}


  }

export default Index;
